import React from "react";
import "../Styles/About.css";
import profileImage from "../Images/headshot.JPEG"; 
import Connect from '../Components/Connect'; 
const About = () => {
    return (
      <div className="about-container">
        <div className="about-image">
          <img src={profileImage} alt="Profile" />
        </div>

        <div className="about-text">
          <h1>About Me</h1>
          <p>
            I'm passionate about UI/UX design and development. My goal is to create seamless and engaging user experiences.
          </p>
          <p>
            I have experience in frontend development, product design, and digital marketing strategies.
          </p>

          {/* Replacing the LinkedIn button with the Connect component */}
          <Connect />
        </div>
      </div>
    );
  };

  export default About;
